// Variables used by Scriptable.
// These must be at the very top of the file. Do not edit.
// icon-color: yellow; icon-glyph: sun;

// -- config --

// The time and date we become tarnished
const countDownDate = new Date("Jan 23, 2022 0:00:00").getTime();

// Want to see the title text within the widget
const isTitleTextEnabled = true;
const titleString = "Elden rinG";

// The suffix text of wait within the widget
const daysString = "Days";
const hoursString = "Hours";
const minsString = "Mins";

// When the time is up and there is nothing to count down to, text
// within widget
const timeUpString = "You are now tarnished";

// Want a notification when its out?
const isNotificationEnabled = true;

// The title and body of the notification
const notificationTitleString = timeUpString;
const notificationBodyString = "Elden Ring is out now!";

// Save image/s in the iCloud directory (can use the Files app) then
// use (copy/paste) the file name into storedImageNames array.
// If you cannot see the extension name in Files app; click the (i)
// info icon on the file
//
// eg. const storedImageName = [
//  "cool_elden_ring_background.png",
//  "an_awesome_image_of_the_valkyrie.jpg"
// ]
//
// iCloud Drive/
// ├─ Scriptable/
// │  ├─ Elden Ring Countdown.js
// │  ├─ Elden Ring Countdown/
// │  │  ├─ cool_elden_ring_background.png
// │  │  ├─ an_awesome_image_of_the_valkyrie.jpg
//
const storedImageNames = []

// -- end config --

const now = new Date().getTime();
const distance = countDownDate - now;
const isTimeUp = distance <= 0

const mins = Math.ceil(distance / (1000 * 60));
const hours = Math.ceil(mins / 60);
const days = Math.ceil(hours / 24);


let waitTextString = timeUpString;

if (hours === 0) {
  waitTextString = `${mins.toString(10)} ${minsString}`;
} else if (days === 0){
  waitTextString = `${hours.toString(10)} ${hoursString}`;
} else if (!isTimeUp) {
  waitTextString = `${days.toString(10)} ${daysString}`;
}

const img = isTimeUp ? getLogoImage() : await getRandomImage(storedImageNames);

let widget = createWidget(titleString, waitTextString, img, isTimeUp, isTitleTextEnabled);

if (config.runsInWidget) {
  Script.setWidget(widget);
  Script.complete();
}
else {
  widget.presentLarge();
}

if (isNotificationEnabled && isTimeUp && hours > -2) {
  scheduleNotification(notificationTitleString, notificationBodyString);
}

function scheduleNotification(notificationTitleString, notificationBodyString) {
  let not = new Notification();
  not.title = notificationTitleString;
  not.body = notificationBodyString;
  not.schedule();
}

function createWidget(titleString, waitTextString, img, isTimeUp = false, isTitleTextEnabled = true) {
  let widget = new ListWidget()

  const font = new Font("Copperplate", 23);
  const fontColor = new Color("#FFEF99");
  const textOpacity = .75;
  const shadowColor = Color.orange();
  const shadowRadius = 3;
  const shadowOffset = new Point(0, 0);

  if(!isTimeUp && isTitleTextEnabled) {
    let titleText = widget.addText(titleString)
    titleText.font = font;
    titleText.textColor = fontColor;
    titleText.textOpacity = textOpacity;
    titleText.shadowColor = shadowColor;
    titleText.shadowRadius = shadowRadius;
    titleText.shadowOffset = shadowOffset;
    titleText.leftAlignText();
  }

  widget.addSpacer()

  let waitText = widget.addText(waitTextString);
  waitText.font = font;
  waitText.textColor = fontColor;
  waitText.textOpacity = textOpacity;
  waitText.shadowColor = shadowColor;
  waitText.shadowRadius = shadowRadius;
  waitText.shadowOffset = shadowOffset;

  if(isTimeUp) {
    waitText.centerAlignText();
  } else {
    waitText.rightAlignText();
  }

  widget.backgroundColor =Color.black();
  widget.backgroundImage = img;

  return widget
}

//
// helpers
//

async function getStoredImage(storedImageName) {
  let folderName = "Elden Ring Countdown";

  let fm = FileManager.iCloud();
  let dir = fm.documentsDirectory();
  let path = fm.joinPath(dir + "/" + folderName, storedImageName);
  await fm.downloadFileFromiCloud(path);
  let isDownloaded = await fm.isFileDownloaded(path);

  if (fm.fileExists(path) && isDownloaded) {
    return fm.readImage(path);
  } else {
    console.error("Error: File does not exist or failed to download.");
  }
}

async function getRandomImage(storedImageNames) {
  if(storedImageNames && storedImageNames.length > 0) {
    const storedImageName = storedImageNames[Math.floor(Math.random() * storedImageNames.length)];
    return await getStoredImage(storedImageName);
  } else {
    const imageDataArray = new Array(
      getTarnishedImageDataString(),
      getValkyrieImageDataString(),
      getPotFamilyImageDataString(),
    );
    const imgData = Data.fromBase64String(imageDataArray[Math.floor(Math.random() * imageDataArray.length)]);
    return Image.fromData(imgData);
  }
}

function getLogoImage() {
  const imgData = getLogoImageDataString();
  return Image.fromData(imgData);
}

